import React, { Component } from 'react';

class PersonalizationGrid extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        const imgUrl = new URL(this.props.Image);
        return (
            <div>
                <div>
                    <img src={imgUrl} />
                </div>
                <div>{this.props.DisplayText}</div>
            </div>
        )
    }

}

export default Card;
